$(document).ready(function(){
    // DESIGN
    $('.get-seiling-pallet .color-picker-btn, .get-seiling-pallet .color-picker-input').on('click', function(){
        $('.pallet-container').addClass('active');
    });
    $('.pallet-modal-header .modal-close-btn').on('click', function(){
        $('.pallet-container').removeClass('active');
    });
    
    $('ul.interior-rooms-tabs-nav').on('click', 'li:not(.active)', function() {
		$(this)
			.addClass('active').siblings().removeClass('active')
			.closest('div.interior-rooms-tabs').find('div.interior-rooms-content').removeClass('active').eq($(this).index()).addClass('active');
	});
	
	$('.pallet-tabs li').on('click', function(){
	    var pallet = '.' + $(this).attr('data-tab');
	    $('.pallet-window').removeClass('active');
	    $(pallet).addClass('active');
	});
	

	
	
	$('.pallet-lack').on('change', '.pallet-radio', function(){
	    $('.interior-rooms-content.active .interior-room-svg').attr('width', '100%').attr('height', '100%')
	    
	    var color = $(this).parent().find('.pallet-color').attr('data-color');
	    
	    var color = $(this).parent().find('.pallet-color').attr('data-color');
	    
	    $('.checked-color-visual').css('background','#' + color).show()
	    
	    $('.get-seiling-pallet .color-picker-input').css('background','#'+color);
	    
	    var title = $(this).parent().find('.pallet-color').attr('data-title');
	    $('.checked-color').text(title);
	    
	    $('.interior-rooms-content.active .seiling-svg path').attr('fill', '#'+color);
	    $('.interior-rooms-content.active .seiling-effect').css('opacity','1');
	    
	    var i = 0;
	    $('.interior-rooms-content').each(function(){
	        i++;
	        if($(this).hasClass('active')){
	            $('.seiling-effect #seilingEffect'+i).html('');
	            $('.seiling-effect .seiling-effect-img').attr('filter','');
	            $('.interior-rooms-content.active .pic-seiling-effect .seiling-effect-img').removeClass('seilingEffect'+i)
	            $('.interior-rooms-content.active .pic-seiling-effect').css('opacity','1')
	            if(i == 3 || i == 4){
	                
	                var colorRGB = hexToRGB(color)
            	    
            	    
            	    
            	    var shadowEffectR = (colorRGB.R - (colorRGB.R * 0.65)) / 100
            	    var shadowEffectG = (colorRGB.G - (colorRGB.G * 0.65)) / 100
            	    var shadowEffectB = (colorRGB.B - (colorRGB.G * 0.65)) / 100
            	    
            	    var shadowR = shadowEffectR.toFixed(4) + ' 0 0 0 0 '
            	    var shadowG = '0 ' + shadowEffectG.toFixed(4) + ' 0 0 0 '
            	    var shadowB = '0 0 ' + shadowEffectB.toFixed(4) + ' 0 0 '
            	    var colorMatrix = shadowR + shadowG + shadowB + '0 0 0 1 0'
            	    $('.seiling-effect #seilingEffect'+i).html('<feColorMatrix color-interpolation-filters="sRGB" in="SourceGraphic" type="matrix" values="'+colorMatrix+'"/>');
            	    
            	    $('#seilingEffect'+i+' feColorMatrix').attr('values', colorMatrix)
            	   
	                $('.interior-rooms-content.active .pic-seiling-effect .seiling-effect-img').addClass('seilingEffect'+i)
	                $('.interior-rooms-content.active .pic-seiling-effect').css('opacity','1')
	                $('.interior-rooms-content.active .pic-seiling-effect-2').css('opacity','.5')
	                
    	            $('.seiling-effect-2 #seilingEffect'+i+'_2').html('');
    	            $('.seiling-effect-2 .seiling-effect-img').attr('filter','');
    	            $('.pic-seiling-effect-2 .seiling-effect-img').removeClass('seilingEffect'+i+'_2')
    	            
	            }
	        }
	    });
	    $('.seiling-svg, .seiling-effect').css('display', 'block');
	});
	
	
	$('.pallet-mat').on('change', '.pallet-radio', function(){
	    $('.interior-rooms-content.active .interior-room-svg').attr('width', '100%').attr('height', '100%')
	    
	    var color = $(this).parent().find('.pallet-color').attr('data-color');
	    $('.get-seiling-pallet .color-picker-input').css('background','#'+color);
	    
	    $('.checked-color-visual').css('background','#' + color).show()
	    
	    var title = $(this).parent().find('.pallet-color').attr('data-title');
	    $('.checked-color').text(title);
	    
	    $('.interior-rooms-content.active .seiling-svg path').attr('fill', '#'+color);
	    $('.interior-rooms-content.active .seiling-effect').css('opacity','0.15');
	    var i = 0;
	    $('.interior-rooms-content').each(function(){
	        i++;
	        if($(this).hasClass('active')){
	            $('.seiling-effect #seilingEffect'+i).html('<feGaussianBlur stddeviation="10" />');
	            $('.seiling-effect .seiling-effect-img').attr('filter','url(#seilingEffect'+i+')');
	            $('.interior-rooms-content.active .pic-seiling-effect .seiling-effect-img').addClass('seilingEffect'+i)
	            $('.interior-rooms-content.active .pic-seiling-effect').css('opacity','0.3')
	        }
	    });
	    $('.interior-rooms-content.active .seiling-effect-2').css('opacity','0');
	    $('.interior-rooms-content.active .pic-seiling-effect-2').css('opacity','0')
	    $('.seiling-svg, .seiling-effect').css('display', 'block');
	});
	
	
	$('.pallet-satin').on('change', '.pallet-radio', function(){
	    $('.interior-rooms-content.active .interior-room-svg').attr('width', '100%').attr('height', '100%')
	    
	    var color = $(this).parent().find('.pallet-color').attr('data-color');
	    $('.get-seiling-pallet .color-picker-input').css('background','#'+color);
	    
	    $('.checked-color-visual').css('background','#' + color).show()
	    
	    var title = $(this).parent().find('.pallet-color').attr('data-title');
	    $('.checked-color').text(title);
	    
	    $('.interior-rooms-content.active .seiling-svg path').attr('fill', '#'+color);
	    $('.interior-rooms-content.active .seiling-effect').css('opacity','.8');
	    var i = 0;
	    $('.interior-rooms-content').each(function(){
	        i++;
	        if($(this).hasClass('active')){
    	        if(i == 3 || i == 4){
    	            $('.interior-rooms-content.active .seiling-effect-2').css('opacity','.7');
    	            $('.interior-rooms-content.active .pic-seiling-effect-2').css('opacity','.7');
    	            
    	            $('.interior-rooms-content.active .seiling-effect').css('opacity','0');
    	            $('.interior-rooms-content.active .pic-seiling-effect').css('opacity','0');
    	            
    	            
    	            $('.seiling-effect-2 #seilingEffect'+i+'_2').html('<feGaussianBlur stddeviation="4" />');
    	            $('.seiling-effect-2 .seiling-effect-img').attr('filter','url(#seilingEffect'+i+'_2)');
    	            $('.interior-rooms-content.active .pic-seiling-effect-2 .seiling-effect-img').addClass('seilingEffect'+i+'_2');
    	        } else {
    	            $('.seiling-effect #seilingEffect'+i).html('<feGaussianBlur stddeviation="4" />');
    	            $('.seiling-effect .seiling-effect-img').attr('filter','url(#seilingEffect'+i+')');
    	            $('.interior-rooms-content.active .pic-seiling-effect .seiling-effect-img').addClass('seilingEffect'+i)
    	        }
	        }
	    });
	    $('.seiling-svg, .seiling-effect').css('display', 'block');
	});
	
	
	
	
	$('#colorInput_1').on('change keyup blur', function(){
	    $('.interior-rooms-content.active .interior-room-svg').attr('width', '100%').attr('height', '100%')
	    
	    var colorHex = '#' + $(this).val()
	    var colorRGB = hexToRGB(colorHex)
	    $('.interior-rooms-content.active .inerior-color-1 path').attr('fill', colorHex);
	    $('.interior-rooms-content.active .inerior-color-1, .interior-rooms-content.active .interior-shadows-1').css('display', 'block');
	    
	    var shadowColorR = (colorRGB.R - (colorRGB.R * 0.65)) / 100
	    var shadowColorG = (colorRGB.G - (colorRGB.G * 0.65)) / 100
	    var shadowColorB = (colorRGB.B - (colorRGB.B * 0.65)) / 100
	    
	    var shadowR = shadowColorR.toFixed(4) + ' 0 0 0 0 '
	    var shadowG = '0 ' + shadowColorG.toFixed(4) + ' 0 0 0 '
	    var shadowB = '0 0 ' + shadowColorB.toFixed(4) + ' 0 0 '
	    
	    var colorMatrix = shadowR + shadowG + shadowB + '0 0 0 0.75 0'
	    //$('.interior-rooms-content.active .interior-shadows-1 feColorMatrix').attr('values', colorMatrix)
	    
	    var filterId = $('.interior-rooms-content.active .interior-shadows-1 filter').attr('id')
	    $('.interior-rooms-content.active .interior-shadows-1').html('<filter id="'+filterId+'" filterUnits="objectBoundingBox"><feColorMatrix color-interpolation-filters="sRGB" in="SourceGraphic" type="matrix" values="'+colorMatrix+'"/></filter>')
	    
	    $('.interior-rooms-content.active .svg-interior-shadows-1 img').addClass(filterId)
	    
	    //$('.svg-img').addClass('matrix')
	    //$('#color').html('<div>'+shadowR+'</div><div>'+shadowG+'</div><div>'+shadowB+'</div><div>'+colorMatrix+'</div>')
	});
	$('#colorInput_2').on('change keyup blur', function(){
	    $('.interior-rooms-content.active .interior-room-svg').attr('width', '100%').attr('height', '100%')
	    
	    var colorHex = '#' + $(this).val()
	    var colorRGB = hexToRGB(colorHex)
	    $('.interior-rooms-content.active .inerior-color-2 path').attr('fill', colorHex);
	    $('.interior-rooms-content.active .inerior-color-2, .interior-rooms-content.active .interior-shadows-2').css('display', 'block');
	    
	    var shadowColorR = (colorRGB.R - (colorRGB.R * 0.65)) / 100
	    var shadowColorG = (colorRGB.G - (colorRGB.G * 0.65)) / 100
	    var shadowColorB = (colorRGB.B - (colorRGB.B * 0.65)) / 100
	    
	    var shadowR = shadowColorR.toFixed(2) + ' 0 0 0 0 '
	    var shadowG = '0 ' + shadowColorG.toFixed(2) + ' 0 0 0 '
	    var shadowB = '0 0 ' + shadowColorB.toFixed(2) + ' 0 0 '
	    var colorMatrix = shadowR + shadowG + shadowB + '0 0 0 0.75 0'

        var filterId = $('.interior-rooms-content.active .interior-shadows-2 filter').attr('id')
	    $('.interior-rooms-content.active .interior-shadows-2').html('<filter id="'+filterId+'" filterUnits="objectBoundingBox"><feColorMatrix color-interpolation-filters="sRGB" in="SourceGraphic" type="matrix" values="'+colorMatrix+'"/></filter>')
	    
	    $('.interior-rooms-content.active .svg-interior-shadows-2 img').addClass(filterId)
	});

    function hexToRGB(hex)
    {
        var long = parseInt(hex.replace(/^#/, ""), 16);
        return {
            R: (long >>> 16) & 0xff,
            G: (long >>> 8) & 0xff,
            B: long & 0xff
        };
    }
})

